import axios from 'axios';
import { FormValues, ReservationApiData, GetReservationApiData } from '../../interface/Reservation';

export const postReservation = (inputs: FormValues): Promise<ReservationApiData> => {
    return axios.post('./reservation/', inputs)
        .then((res) => res.data)
        .catch((error) => ({
            error: { message: 'error! please try again later' }
        }));
};

export const getReservations = (): Promise<GetReservationApiData> => {
    return axios.get('./reservation/')
        .then((res) => res.data)
        .catch((error) => ({
            error: { message: 'error! please try again later' }
        }));
};
